column8:
お好きな香りを全種から3つお選びいただけます。<br>
●香りの説明<br>
5401／ホワイトウォーター／シャープでみずみずしいスカッシュの香り。<br>
5403／トロピカル／トロピカルフルーツと華やかなフローラルが調和した香り。<br>
5404／シャンプー／フレッシュなアップルと柔らかなムスクが奏でるフルーティムスクの香り。<br>
5406／スカッシュ／官能的なウッディムスクにスカッシュがさわやかに香り立つクールな香り。<br>
5407／セクシーエアー／ベリー系のふんわりとした甘みが心地よい優美な香り。<br>
5408／ピーチ＆キッス／みずみずしいピーチを可憐なフローラルブーケと合わせたフレッシュピーチの香り。<br>
5531／ブルーーウォーター／カシスやシトラスフルーツが特徴のフルーティスカッシュの香り。<br>
5536／リゾートサワー／ハーブ系フローラルにフルーツの香りを加えたさわやかな香り。<br>
5537／ホワイトムスク／ふんわり華やかなフローラルフルーティムスクの香り。<br>
5539／ライトスカッシュ／はじけるラムネをイメージした爽快な香り。<br>
7311／スウィーツ・デ・ハッピー／心地よく、すっきりとした甘さが特徴の香り。<br>
7313／ベリー＆ベリー／ベリーのもつ奥深い甘さと甘酸っぱさをうまく調和させた香り。<br>
7314／ふんわり柔軟剤の香り／春のやさしさあふれるピンクフローラルの香り。<br>
7315／エンジェルスノー／あたたかで高級感のあるフルーティフローラルの香り。<br>
7316／セレブリティ／ニヒルで深みのあるブラックローズの香り。<br>
7317／ナイトエンジェル／センシュアルで艶やかな香り。<br>
7318／エレガントシャワー／フローラルにウッディ、ムスクを合わせたゴージャスな香り。<br>
7319／クリアマリン／透明なうるおい感のあるマリンフローラルの香り。<br>7741／グリーンアップル／すっきりとりたグリーンアップルの香り。<br>
7742／ピュアアップル／明るくやさしいピュアアップルの香り<br>
●商品サイズ（パッケージ）／H75×W80×D72mm<br>
●内容量／85g<br>
●MADE IN JAPAN／日本製<br>
※掲載画像と製品の実際の色とは若干異なる場合があります。
あらかじめご了承いただきますようにお願い致します。<br>
<br>
【車用芳香剤】そこにあるだけでお洒落な空間へと導く…、それがビッカラです。虚飾を排した機能美あふれるそのフォルムは、それが空間を快適なものへと導くものであることを無言に語りかけます。安定感ある容器で、車内でも違和感なく設置できます。中味には爽やかな香料に加え、評価の高い消臭酵素を配合しています 。<br><style type="text/css">
