8025／セクシーソープ／トロピカルフルーツと華やかなフローラルが調和したセクシーな香り。<br>
8026／シルキーホワイト／エレガントなフローラルウッディの香り。<br>
8027／ピーチ＆キッス／みずみずしいピーチを可憐なフローラルブーケと合わせたフレッシュピーチの香り。<br>
